package MapConstructor;

public class Answer {

	String id;
	String name;
	public Answer() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Answer(String id, String name) {
		super();
		this.id = id;
		this.name = name;
	}
	@Override
	public String toString() {
		return "Answer [id=" + id + ", name=" + name + "]";
	}
	
	
}
